   "source": [
    "## **PREPARE PHASE**\n",
    "\n",
    "For this case study, we were instructed to use data from a real bike-sharing service, [Divvy](http://divvy-tripdata.s3.amazonaws.com/index.html). I downloaded data for the previous 12 months. The files are all in .csv format. I already see that the file names conform with the standard naming conventions, so I retained them. Then, I made sure to store all files in one folder. \n",
    "\n",
    "#### **Is the data ROCCC?**\n",
    "\n",
    "1. **Reliable** - Yes. According to [the data source](https://divvybikes-marketing-staging.lyft.net/system-data), the data includes trip data taken by casual riders and members. The data is processed to remove rides taken by staff, as well as rides that are less than 60 second in duration. The data does not include personally identiable information of riders.\n",
    "   \n",
    "3. **Original** - Yes. The data were taken directly from first-party source.\n",
    "   \n",
    "4. **Comprehensive** - Yes. The business task is to determine how casual riders and members use bikes differently. The data includes rider type (member or casual), as well as trip start date/time and trip end date/time. These are the critical information needed to find answers to our business task.\n",
    "   \n",
    "5. **Current** - Yes. Data includes trip information over the last 12 months (March 2024 to February 2025).\n",
    "   \n",
    "6. **Cited** - Yes. The [source's website](https://divvybikes-marketing-staging.lyft.net/system-data) contains information on what data are being collected, and how they are being collected and processed. Furthermore, the [Data License Agreement](https://divvybikes.com/data-license-agreement) states the public is granted access to the the data, along with other terms that ensure data is used legally."
   ]
  },
