    "## **PROCESS PHASE**\n",
    "\n",
    "For this case study, I chose R for the entirety of data processing, analysis and visualization process. I am dealing with relatively large datasets, some files having more than 800,000 rows. R's ***dplyr*** package is well-equipped to handle this volume of data efficiently. This helped me to combine and manipulate these files into a single data frame quickly and effectively. Furthermore, it is helpful in filtering, sorting, aggregating and transforming the combined data, which is a very large dataset. Lastly, ggplot2 proved helpful in quickly visualizing my analyses and findings.\n",
    "\n",
    "**Note:** During this stage, I utilized Gemini AI to assist me with some of the R codes and functions. Although R is part of the Data Analytics course, this is my first time applying what I learned and I still have some room for improvement with using this programming language for data analysis.  Specifically, prompts were used to identify appropriate functions and generate code snippets based on my data cleaning and processing needs. I made sure to iterate rigorously, testing and modifying the generated codes, to ensure that they align with my analytical objectives for this analysis, as well as the specific requirements of the dataset. While I used AI for this specific purpose, all the analytical decisions, interpretation of findings and recommendations are done by me."
   ]
