    "# Combine all .csv files into 1 data frame (12 files representing Cyclistic bikeride data over the last 12 months)\n",
    "folder_path <- \"/kaggle/input/divvy-tripdata\"\n",
    "file_list <- list.files(path = folder_path, pattern = \"^(2024|2025).*\\\\.csv$\", full.names = TRUE)\n",
    "bikedata_12month <- file_list %>%\n",
    "  map_dfr(~ read_csv(., show_col_types = FALSE))"
   ]
