   "source": [
    "7. Next, I created a column to calculate trip durations. I named the column *ride_length*, and named the data frame *bikeshare_data_cleaned*:"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 8,
   "id": "4940f580",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2025-04-07T23:40:35.363517Z",
     "iopub.status.busy": "2025-04-07T23:40:35.361862Z",
     "iopub.status.idle": "2025-04-07T23:40:52.082638Z",
     "shell.execute_reply": "2025-04-07T23:40:52.080773Z"
    },
    "papermill": {
     "duration": 16.734365,
     "end_time": "2025-04-07T23:40:52.086385",
     "exception": false,
     "start_time": "2025-04-07T23:40:35.352020",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "# Create a new column for ride_length\n",
    "bikeshare_data_cleaned <- bikedata_12month %>%\n",
    " mutate(ride_length = as.duration(ended_at - started_at),\n",
    "     ride_length = round(as.numeric(ride_length, 'minutes')),\n",
    "     day_of_week = wday(started_at, label = TRUE, abbr = TRUE),\n",
    "     hour = hour(started_at),\n",
    "     month = month(started_at, label = TRUE, abbr = TRUE))"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "805a1a46",
   "metadata": {
    "papermill": {
     "duration": 0.008313,
     "end_time": "2025-04-07T23:40:52.102506",
     "exception": false,
     "start_time": "2025-04-07T23:40:52.094193",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "8. I used ***summary()*** to check the minimum and maximum values in the *ride_length*, and confirmed 2 issues that may affect the accuracy of the data and skew my analysis. I resolved this by using the parameters defined by the data source on what constitutes a standard bike trip.\n",
    "\n",
    "    a. **Negative values** - Apart from the negative values in *ride_length*, I also removed the trips with less than 1 minute duration. According to the [data source](https://divvybikes-marketing-staging.lyft.net/system-data), the raw data was supposed to exclude ride lengths below 60 seconds, as they are \"potentially false starts or users trying to re-dock a bike to ensure it was secure.\"\n",
    "\n",
    "    b. **Extremely long ride lengths** - The maximum value is 1,560 minutes, which is roughly 26 hours. These high values are possibly due to a technical glitch or user error. I have decided to remove all trips that are more than 3 hours long. I have come to this decision based on Cyclistic's [rates](https://divvybikes.com/pricing) for each ride options. The longest a rider can use a bicycle (Day Pass option) before they start incurring additional charges per minute is 3 hours. This suggests that rides exceeding 3 hours are no longer standard trips based on this parameter, but rather extended rentals, likely with different user behavior and motivations. With the removal of trips that are more than 3 hours, I can focus on the data that represents the most common use case."
   ]
  },
