   "source": [
    "# Calculate average ride length by day of week and member type\n",
    "avg_ride_length_by_day <- bikeshare_data_cleaned %>%\n",
    "  group_by(day_of_week, member_casual) %>% # Group by both day_of_week and member_casual\n",
    "  summarize(avg_ride_length_mins = round(mean(ride_length)))\n",
    "\n",
    "# Create a bar chart to visualize the average ride length\n",
    "ggplot(avg_ride_length_by_day, aes(x = day_of_week, y = avg_ride_length_mins, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Average Ride Length by Day of Week\",\n",
    "    x = \"Day of Week\",\n",
    "    y = \"Average Ride Length (minutes)\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(strip.text.x = element_text(size = 12),\n",
    "        plot.title = element_text(hjust = 0.5, face = \"bold\", size = 18),\n",
    "        axis.text.x = element_text(hjust = 1)) +\n",
    "  scale_x_discrete(limits = c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\", \"Sat\", \"Sun\"))"
   ]
