   "source": [
    "# Average ridership by day of the week and member type\n",
    "daily_usage <- bikeshare_data_cleaned %>%\n",
    "  group_by(member_casual, day_of_week, date = as.Date(started_at)) %>%\n",
    "  summarise(daily_rides = n()) %>%\n",
    "  group_by(member_casual, day_of_week) %>%\n",
    "  summarise(avg_rides = mean(daily_rides))\n",
    "\n",
    "# Create the bar plot with facets\n",
    "ggplot(daily_usage, aes(x = day_of_week, y = avg_rides, fill = member_casual)) + # Changed y-axis to avg_rides\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Average Ridership by Day of Week\",\n",
    "    x = \"Day of the Week\",\n",
    "    y = \"Average Number of Rides\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(strip.text.x = element_text(size = 12),  # Make facet labels bold\n",
    "        plot.title = element_text(hjust = 0.5, face = \"bold\", size = 18),\n",
    "        axis.text.x = element_text(angle = 45, hjust = 1)) + # Angle x-axis labels\n",
    "  scale_x_discrete(limits = c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\", \"Sat\", \"Sun\")) +\n",
    "  scale_y_continuous(labels = scales::comma) # Format y-axis labels with commas"
   ]
  },
