   "source": [
    "The first bar chart above shows casual riders, on average, spend more time riding Cyclistic bicycles than annual members. Casual riders spend an average of 19 minutes, while annual members use Cyclistic bikes at a much shorter time, at 12 minutes average. \n",
    "\n",
    "The second bar chart shows both casual riders and annual members spend more time riding bikes during the weekends, compared to the workweeks. \n",
    "\n",
    "Finally, the third chart shows that peak ridership among casual riders is during the weekend, while most annual members use bikes during the workweek compared to the weekend.\n",
    "\n",
    "This findings could signify that annual members mostly use Cyclistic bicycles to commute, while casual members use the bikes for leisure purposes. To confirm this, I checked the distribution of riders for each hour of the day, and across all ride lengths."
   ]
