   "source": [
    "# Create a histogram of ride_length, faceted by member_casual\n",
    "ggplot(bikeshare_data_cleaned, aes(x = ride_length, fill = member_casual)) +\n",
    "  geom_histogram() +\n",
    "  facet_wrap(~member_casual, ncol = 1) +\n",
    "  labs(\n",
    "    title = \"Distribution of Ride Length by Member Type\",\n",
    "    x = \"Ride Length (minutes)\",\n",
    "    y = \"Frequency\"\n",
    "  ) +\n",
    "  xlim(0, 180) +\n",
    "  theme_minimal() +\n",
    "  theme(plot.title = element_text(hjust = 0.5, face = \"bold\")) +\n",
    "  scale_y_continuous(labels = scales::comma) # Format y-axis labels with commas"
   ]
  },
