   "source": [
    "The line chart above shows the peak usage for each member type. Peak usage of Cyclistic bikes among annual members were during the rush hours, at 8:00am and 5:00pm. The number of casual riders, on the other hand, gradually increased throughout the day until reaching its peak at 5:00pm. \n",
    "\n",
    "On the other hand, the histogram shows that a large proportion of rides among casual riders and annual members are relatively short, with peak between 5 and 10 minutes. \n",
    "\n",
    "Based on these findings, most of annual riders indeed use Cyclistic bikes for their daily commute. The same can be said for casual riders, but only during the late rush hour. Apart from this, the short rides could also mean that majority of the riders, both casual and members, use Cyclistic bikes to run errands or, to travel to nearby places efficiently, avoiding traffic or the hassle of using public tranport for commuting."
   ]
  },
