   "source": [
    "# Calculate count of riders and average ride length per month\n",
    "month_over_month_data <- bikeshare_data_cleaned %>%\n",
    "  group_by(member_casual, month) %>%\n",
    "  summarise(rider_count = n(),\n",
    "            avg_ride_length = round(mean(ride_length))\n",
    "            )\n",
    "\n",
    "# Order by Mar 2024 to Feb 2025 and convert month to ordered factor\n",
    "month_order <- c(\"Mar\", \"Apr\", \"May\", \"Jun\", \"Jul\", \"Aug\", \"Sep\", \"Oct\", \"Nov\", \"Dec\", \"Jan\", \"Feb\")\n",
    "month_over_month_data <- month_over_month_data %>%\n",
    "  mutate(month = factor(month, levels = month_order))"
   ]
  },
