   "source": [
    "# Create the bar chart for average ride length per month\n",
    "ggplot(month_over_month_data, aes(x = month, y = avg_ride_length, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Monthly Average Ride Length By Member Type\",\n",
    "    subtitle = \"Data from March 2024 to February 2025\",\n",
    "    x = \"Month\",\n",
    "    y = \"Average Ride Length\",\n",
    "    fill = \"Member Type\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(plot.title = element_text(hjust = 0.5, face = \"bold\")) +\n",
    "  theme(plot.subtitle = element_text(hjust = 0.5, size = 10))"
   ]
