    "# Create the bar chart for monthly rider counts per month\n",
    "ggplot(month_over_month_data, aes(x = month, y = rider_count, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Monthly Ridership by Member Type\",\n",
    "    subtitle = \"Data from March 2024 to February 2025\",\n",
    "    x = \"Month\",\n",
    "    y = \"Number of Riders\",\n",
    "    fill = \"Member Type\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(plot.title = element_text(hjust = 0.5, face = \"bold\")) +\n",
    "  theme(plot.subtitle = element_text(hjust = 0.5, size = 10)) +\n",
    "  scale_y_continuous(labels = scales::comma)"
   ]
  },
