   "source": [
    "## **ACT PHASE**\n",
    "\n",
    "Based on the analysis and findings, below are my top 3 recommendations on new marketing strategies aimed at converting casual riders to annual members:\n",
    "\n",
    "\n",
    "#### **Explore the possbility of offering different types of membership plans based on riders' needs/usage patterns:**\n",
    "\n",
    "Data showed that a significant amount of casual riders use Cyclistic bikes for a relatively short time. This can signify that these casual riders use the bikes for their daily commute, to run errands, or to travel to nearby locations effectively. In short, riders use Cyclistic bikes depending on their needs. Hence, we can explore the possiblity of offering different types of membership plans based on the riders' needs or usage patterns. This can make riders feel empowered by giving them choice and flexibility, thus increasing the value proposition of becoming an annual member.  Below are the recommended annual membership plans:\n",
    "\n",
    "1. Individual Plan - this is the existing plan that Cyclistic offers.\n",
    "2. Weekend Warrior Plan - offers annual membership plans to riders who mostly use our bikes for leisure during the weekend.\n",
    "3. Workday Rider Plan - offers annual membership plans to riders who mostly rides to commute to work\n",
    "4. Campus Cruisers Plan - offers annual memberships to students who use our bikes to go to school.\n",
    "Rates and usage guidelines for each plan to be determined.\n",
    "\n",
    "\n",
    "#### **Make annual membership more exciting by doing competitions or personal milestone achievements:**\n",
    "\n",
    "Although most casual riders use Cyclistic bikes for a relatively short time, we cannot fully conclude that majority of these rides are due to daily commute or running errands. In fact, data from Cyclistic shows only 30% of Cyclistic users ride bikes to commute to work each day, while the other users are more likely to ride for leisure purposes. \n",
    "\n",
    "We can specifically target the casual riders who use Cyclistic bikes for leisure purposes by initiating competitions and milestone achievements. These types of activities give the members a sense of achievement, community, and enjoyment, thus encouraging existing annual members to continue their subscription, as well as  casual members to get an annual membership. \n",
    "\n",
    "We can also use these competitions and milestone achievements to reward members in the form of points. For example, members can earn points from these events, which they can then convert into discounts they can apply for their annual membership renewal. This encourages members to renew their membership, thus providing a tangible reward for their continued loyalty.\n",
    "\n",
    "\n",
    "#### **Create ads that focus on the sustainability and health benefits of using bicycles:**\n",
    "\n",
    "Most casual riders take short trips using Cyclistic bike data. Although the annual membership plan would sound like something that would fit their needs, it would not make sense for them if they don’t regularly use bikes. Hence, we will give them compelling reasons to use bikes regularly by focusing our ads on the sustainability and health benefits of using bicycles. \n",
    "\n",
    "Along with the benefits that technology provides come negative effects like carbon emissions that contribute to climate change, congested traffic, and reduced physical activities, among others. These have become global problems that are now threatening our health as well as our home planet. This is in a way, hitting two birds with one stone: encouraging casual riders to switch to annual memberships, and at the same time, promoting sustainable transportation and healthier lifestyle.\n",
    "\n"
   ]
